import React from 'react'
import { Button, Divider } from 'semantic-ui-react'


export default class Welcome extends React.Component {

    render() {

        return (
            <center>
                <Divider hidden/>
                <Button.Group size='large'>
                    <Button>Login</Button>
                    <Button.Or />
                    <Button>Register</Button>
                </Button.Group>
            </center>
        )
    }

}
